import React from "react";
import ReactDOM from "react-dom";

class Footer extends React.Component {
  render() {
    return (
      <div style={{ backgroundColor: "#f5f8fd" }}>
        <div className="container"> </div>
      </div>
    );
  }
}

export default Footer;
